    inp = str(len(arr)) + '\n' + ' '.join(map(str,arr)) + '\n'
    p = Popen(["/opt/openhands-venv/bin/python3","solution.py"], stdin=PIPE, stdout=PIPE, stderr=PIPE, text=True)
    out, err = p.communicate(inp)
    return int(out.strip())

for n in range(2,9):
    for _ in range(50):
        arr = [random.randint(0,20) for _ in range(n)]
        rc = run_solution(arr)
        # compute exact
        from functools import lru_cache
        @lru_cache(None)
        def dp(state):
            if len(state) <= 1:
                return 0
            best = 0
            for i in range(len(state)-1):
                val = abs(state[i]-state[i+1]) + dp(state[:i] + state[i+2:])
                if val > best: best = val
            return best
        exact = dp(tuple(arr))
        if rc != exact:
            print('Mismatch arr=',arr,'sol=',rc,'exact=',exact)
            raise SystemExit
print('All small tests matched')
